import React from 'react';
import SongCard from './SongCard';
import { withRouter } from 'react-router-dom';
//withRouter gives the app the props
class SongList extends React.Component{
  state = {
    songs: []
  }

  componentDidMount = () => {
    Object.keys(this.props.user).length > 0
    ? fetch("http://api.napster.com/v2.2/playlists/featured?apikey=MTU1YjllNjUtOTIwNi00MGJlLWJlOWMtZGYxMjJhZDI0NTk5")
    .then(resp => resp.json())
    .then(playlistObj => this.setState({
      playlistsArr: playlistObj.playlists
    })
    )
    : this.props.history.push("/login")
  }

  // console.log(this.props.playlist.href + '?apikey=MTU1YjllNjUtOTIwNi00MGJlLWJlOWMtZGYxMjJhZDI0NTk5');
  render(){
    return(
      <div>
      <h1>Song List</h1>
      <SongCard/>
      </div>
    )
  }
}

export default withRouter(SongList);
